import { AUTH_ROUTE, SERVICES_ROUTE } from '../../utils/constants';

export function NavBar() {
  const { user } = useContext(Context);

  return (
    <header>
      <div className='container'>
        <N>Clean</N>
        {user.isAuth ? (
          <li>ALjnesklfh</li>
        ) : (
          <nav className='navigation'>
            <NavLink to={SERVICES_ROUTE}>
              Услуги
            </NavLink>
            <NavLink to={AUTH_ROUTE}>
              <PersonIcon sx={{ fontSize: "3rem" }} />
              Войти
            </NavLink>
          </nav>
        )}
      </div>
    </header>
  );
}
